import React from 'react';

import "../css/Pagination.css";

function Pagination({ ele, inicio, final }) {
    return (
        <div className="paginado">
            <button
                className='change_page'
                name='backnumber'
            >
                {'<<'}
            </button>
            <div className='content_btn_page'>
                {
                    countries.length && countries.map((_, i) => {
                        return (
                            <button
                                name='pagenumber' 
                                key={i} id={i + 1}
                                // onClick={() => onclickSelectPage(i + 1)}
                                // disabled={id === (i + 1) ? true : false}
                                // className={id === (i + 1) ? 'btn_page activo' : 'btn_page'}
                            >
                                {i + 1}
                            </button>
                        )
                    }).slice(inicio, final)
                }
            </div>
            <button
                className='change_page'
                name='nextnumber'
            >
                {'>>'}
            </button>

        </div>
    )
}

export default Pagination;
